CREATE DATABASE navidad;

USE navidad;

CREATE TABLE premios
(
  idpremio    INT AUTO_INCREMENT PRIMARY KEY,
  nombre      VARCHAR(50) NOT NULL,
  disponible  SMALLINT    NOT NULL,
  tipo        ENUM('Todos', 'F1', 'F2') NOT NULL
)ENGINE = INNODB;


SELECT * FROM premios;

CREATE TABLE clientes 
(
  idcliente INT AUTO_INCREMENT PRIMARY KEY,
  cliente VARCHAR(150) NOT NULL,
  direccion VARCHAR(300) NOT NULL,
  distrito VARCHAR(50) NOT NULL,
  zona VARCHAR(150) NOT NULL,
  telefono VARCHAR(50) NOT NULL,
  dni VARCHAR(30) NOT NULL,
  tipo VARCHAR(20) NOT NULL,
  activo TINYINT NOT NULL DEFAULT 1
)ENGINE = INNODB;

CREATE TABLE ganadores
(
  idganador INT AUTO_INCREMENT PRIMARY KEY,
  idcliente INT NOT NULL,
  idpremio INT NOT NULL,
  fechahora DATE NOT NULL DEFAULT NOW()
)ENGINE = INNODB;

SELECT * FROM clientes;

